main > div.container-xl:first-child,
main > div.container-lg:first-child,
main > div.container-md:first-child,
main > div.container-sm:first-child,
main > div.container:first-child {
    max-width: 100%;
    padding: 0;
}

div.container-xl:first-child > div.row,
div.container-lg:first-child > div.row,
div.container-md:first-child > div.row,
div.container-sm:first-child > div.row,
div.container:first-child > div.row {
    margin-right: 0;
    margin-left: 0;
}

div.container-xl:first-child > div.row > div:first-child,
div.container-lg:first-child > div.row > div:first-child,
div.container-md:first-child > div.row > div:first-child,
div.container-sm:first-child > div.row > div:first-child,
div.container:first-child > div.row > div:first-child {
    margin: 0;
    padding: 0;
    max-width: 100%;
    flex-basis: 100%;
}

.inset-video-item-container {
    margin-top: 0 !important;
}

.inset-video-item-container > .inset-video-item-image-container {
    min-height: 517px;
    height: 75vh;
}

.inset-video-item-container > .inset-video-item-image-container >  .inset-video-item-play-action-container {
    width: 100%;
}

section[class^='livestream_'] > div[class^='container_'] > div[class^='meta_'] {
    grid-column: 1/4;
}

section[class^='livestream_'] > div[class^='container_'] > div[class^='stream_'] {
    grid-column: 1/10;
    margin-bottom: 2em;
}

:root {
    --nav-corner-radius: 0.5em;
    --nav-border-width: 0.25em;
}

main {
    height: 100%;
    margin: auto;
}

main > div {
    margin: auto;
    margin-top: 10em;
}

main > div > div:last-child {
    visibility: hidden;
    height: 0;
}

#App > div > div {
    top: 0;
}

#root > div {
    visibility: visible;
    height: auto;
}

body {
    grid-template-areas: "nav nav nav" "main main main" "footer footer footer" !important;
    grid-template-columns: auto 1fr auto !important;
    grid-template-rows: auto 1fr auto !important;
}

nav > div {
    display: flex;
    justify-content: center;
    align-items: stretch;
    width: auto !important;
}

nav > div > div:first-child {
    border-width: var(--nav-border-width) 0 var(--nav-border-width) var(--nav-border-width) !important;
    border-radius: var(--nav-corner-radius) 0 0 var(--nav-corner-radius) !important;
}

nav > div > div {
    align-self: stretch;
    border: var(--separator-color) solid 0 !important;
    border-width: var(--nav-border-width) 0 !important;
    border-radius: 0;
}

nav > div > div:last-child {
    border-width: var(--nav-border-width) var(--nav-border-width) var(--nav-border-width) 0 !important;
    border-radius: 0 var(--nav-corner-radius) var(--nav-corner-radius) 0 !important;    
}

nav > div > div > a,
nav > div > div > div {
    height: 100% !important;
    padding: 0.5em;
}
